import styles from './Footer.module.scss'
import Container from 'react-bootstrap/Container';
import Card from 'react-bootstrap/Card';


const Footer = () => {
    return (

        <Container className={styles.footerContainer}>
            <div className={styles.footerContainerDiv}>

                <Card.Footer className="text-muted" className={styles.footerText}>
                    <span dangerouslySetInnerHTML={{ "__html": "&copy;" }} /> Copyright 2021</Card.Footer>
                <ul className={styles.list}>
                    <li><a href="http://facebook.com"><i className="fab fa-facebook fa-3x"></i></a> </li>
                    <li><a href="http://github.com"><i className="fab fa-github fa-3x"></i></a></li>
                    <li><a href="http://linkedin.com"><i className="fab fa-linkedin fa-3x"></i></a></li>
                    <li><a href="http://xing.com"><i className="fab fa-xing-square fa-3x"></i></a></li>

                </ul>
            </div>


        </Container>

    )
}
export default Footer;
